                            SettingsName = "DiskspaceXLST",
                            PropertyName = "Transform",
                            PropertyValue = "<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xsl:stylesheet version=\"1.0\" xmlns:xsl=\"http://www.w3.org/1999/XSL/Transform\">\r\n<xsl:template match=\"/\">\r\n  <html>\r\n  <body>\r\n  <img alt=\"Embedded Image\" width=\"299\" height=\"60\" src=\"data:image/png;base64,\" />\r\n  <h2>DiskSpace Report</h2>\r\n  <table border=\"1\">\r\n    <tr bgcolor=\"#66ccff\">\r\n		<th>PackageID</th>\r\n        <th>QuotaValue</th>\r\n        <th>Bandwidth</th>\r\n        <th>UsagePercentage</th>\r\n        <th>PackageName</th>\r\n        <th>PackagesNumber</th>\r\n        <th>StatusID</th>\r\n        <th>UserID</th>\r\n      <th>Username</th>\r\n        <th>FirstName</th>\r\n        <th>LastName</th>\r\n        <th>FullName</th>\r\n        <th>RoleID</th>\r\n        <th>Email</th>\r\n    </tr>\r\n    <xsl:for-each select=\"//Table1\">\r\n    <tr>\r\n	<td><xsl:value-of select=\"PackageID\"/></td>\r\n        <td><xsl:value-of select=\"QuotaValue\"/></td>\r\n        <td><xsl:value-of select=\"Bandwidth\"/></td>\r\n        <td><xsl:value-of select=\"UsagePercentage\"/>%</td>\r\n        <td><xsl:value-of select=\"PackageName\"/></td>\r\n        <td><xsl:value-of select=\"PackagesNumber\"/></td>\r\n        <td><xsl:value-of select=\"StatusID\"/></td>\r\n        <td><xsl:value-of select=\"UserID\"/></td>\r\n      <td><xsl:value-of select=\"Username\"/></td>\r\n        <td><xsl:value-of select=\"FirstName\"/></td>\r\n        <td><xsl:value-of select=\"LastName\"/></td>\r\n        <td><xsl:value-of select=\"FullName\"/></td>\r\n        <td><xsl:value-of select=\"RoleID\"/></td>\r\n        <td><xsl:value-of select=\"Email\"/></td>\r\n        <td><xsl:value-of select=\"UserComments\"/></td>\r\n    </tr>\r\n    </xsl:for-each>\r\n  </table>\r\n  </body>\r\n  </html>\r\n</xsl:template>\r\n</xsl:stylesheet>"
